import React from "react";

import {
	SearchItemContainer,
	ImageContainer,
	Img,
	Name,
	Price,
} from "./SearchItem.styles";

const SearchItem = ({ id, item }) => {
	const { name, price, imageUrl } = item;
	return (
		<SearchItemContainer>
			<ImageContainer>
				<Img />
			</ImageContainer>
			<Name></Name>
			<Price></Price>
		</SearchItemContainer>
	);
};

export default SearchItem;
